import React, { Component } from 'react';
import axios from 'axios';
import homeImage from '../images/homeImage.png'
import Login from './Login'
const imageWidth = {
    width: '100%',
    height: 'fit-content'
};

class Home extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <table>
                    <tr>
                        <td>
                            <img src={homeImage} style={imageWidth} alt='GrubHub' />
                        </td>
                        <td>
                            <Login />
                        </td>
                    </tr>
                </table>
            </div>
        )
    }
}

export default Home;
